import React, { Component } from 'react'

export class loadingspinnar extends Component {
    render() {
        return (
            <div className='d-flex justify-content-center'>
                <div className="spinner-border  m-3" role="status">
                </div>
            </div>
        )
    }
}

export default loadingspinnar
